import React from 'react';
import { Link } from 'react-router-dom';
import './home.css';

function Home() {
    return (
        <div>
            <h1>Page 1</h1>
            <Link to="/game" className="btn btn-primary">Go to Page 2</Link>
        </div>
    );
}

export default Home;
